import './App.css';
import CourseManager from "./components/course-manager";
import CourseEditor from "./components/course-editor";
import CourseTable from "./components/course-table";

function App() {
  return (
    <div className="container-fluid">
      <CourseManager/>
      <CourseEditor/>
      <CourseTable/>
    </div>
  );

}

export default App;
